import { Input, Card, Button, Space, Form } from "antd";
import { useInput } from "../../components/Generalui/CustomHooks";

const Login = () => {
  const [username, onChangeUsername] = useInput();
  const [password, onChangePassword] = useInput();

  return (
    <Card>
      <Space direction="vertical" size={"large"} style={{ width: "100%" }}>
        <h1>Login</h1>
        <Form>
          <Input addonBefore={`email`} onChange={onChangeUsername} />
          <Input.Password addonBefore={`password`} onChange={onChangePassword} />
          <Button>Login</Button>
        </Form>
      </Space>
    </Card>
  );
};

export default Login;
